import React from 'react';
import './Nav.css';
import { Link } from 'react-router-dom';




const Nav = () => {

    const style = {
        color: 'white'
    };

    return (
    <nav>
        <h3>Logo</h3>
        <ul className="nav-links">
            <Link to="about">
            <li>About</li>
            </Link>
            <Link to="Api">
            <li>Api</li>
            </Link>
        </ul>
    </nav>
    )
}

export default Nav;
